import os
import pytest

from bs4 import BeautifulSoup

from mfr.core.provider import ProviderMetadata
from mfr.extensions.tdms import TdmsRenderer


@pytest.fixture
def metadata():
    return ProviderMetadata('test8', '.tdms', 'text/plain', '1234', 'http://wb.osf.io/file/test6.tdms?token=1234')


@pytest.fixture
def test_tdms_file_path():
    return os.path.join(os.path.dirname(os.path.abspath(__file__)), 'files', 'test6.tdms')


@pytest.fixture
def invalid_tdms_file_path():
    return os.path.join(os.path.dirname(os.path.abspath(__file__)), 'files', 'invalid.tdms')

@pytest.fixture
def url():
    return 'http://osf.io/file/test6.tdms'


@pytest.fixture
def assets_url():
    return 'http://mfr.osf.io/assets'


@pytest.fixture
def export_url():
    return 'http://mfr.osf.io/export?url=' + url()


@pytest.fixture
def renderer(metadata, test_tdms_file_path, url, assets_url, export_url):
    return TdmsRenderer(metadata, test_tdms_file_path, url, assets_url, export_url)


class TestTdmsRenderer:

    def test_render_tdms_file_required(self, renderer):
        assert renderer.file_required is True

    def test_render_tdms_cache_result(self, renderer):
        assert renderer.cache_result is True

    def test_render_tdms(self, test_tdms_file_path, assets_url, export_url):
        metadata = ProviderMetadata('test6', '.tdms', 'text/plain', '1234', 'http://wb.osf.io/file/test6.tdms?token=1234')
        renderer = TdmsRenderer(metadata, test_tdms_file_path, url, assets_url, export_url)
        body = renderer.render()
        name = "sp0006_042419"
        startTime = "wf_start_time: 2019-04-24T18:17:11.234133"
        startFrequency = "4E+05"
        endFrequency = "5E+05"
        plot = """data:image/png;base64,"""

        assert plot in body
        assert startTime in body
        assert startFrequency in body
        assert endFrequency in body
